(0x332f3b716173493fbe8625c5315a1a48, 0x2fbb5fe2e29a4d70aa5854ce7ce3e20b, '{{ salesChannel.name }}', 'Password zurcksetzen - {{ salesChannel.name }}', 'Anfrage zum Zurcksetzen des Passworts', '<div style=\"font-family:arial; font-size:12px;\">\n    <p>\n        Hallo {{ customer.salutation.translated.letterName }} {{customer.firstName}} {{ customer.lastName }},<br/>\n        <br/>\n        im Shop {{ salesChannel.translated.name }} wurde eine Anfrage gestellt, um Ihr Passwort zurck zu setzen.\n        Bitte besttigen Sie den unten stehenden Link, um ein neues Passwort zu definieren.<br/>\n        <br/>\n        <a href=\"{{ resetUrl }}\">Passwort zurcksetzen</a><br/>\n        <br/>\n        Dieser Link ist nur fr die nchsten 2 Stunden gltig. Danach muss das Zurcksetzen des Passwortes erneut beantragt werden.\n        Falls Sie Ihr Passwort nicht zurcksetzen mchten, ignorieren Sie diese E-Mail - es wird dann keine nderung vorgenommen.\n    </p>\n</div>', 'Hallo {{ customer.salutation.translated.letterName }} {{customer.firstName}} {{ customer.lastName }},\n\nim Shop {{ salesChannel.translated.name }} wurde eine Anfrage gestellt, um Ihr Passwort zurck zu setzen.\nBitte besttigen Sie den unten stehenden Link, um ein neues Passwort zu definieren.\n\nPasswort zurcksetzen: {{ resetUrl }}\n\nDieser Link ist nur fr die nchsten 2 Stunden gltig. Danach muss das Zurcksetzen des Passwortes erneut beantragt werden.\nFalls Sie Ihr Passwort nicht zurcksetzen mchten, ignorieren Sie diese E-Mail - es wird dann keine nderung vorgenommen.', NULL, '2023-05-29 13:22:29.820', NULL),
(0x332f3b716173493fbe8625c5315a1a48, 0x7f68cf92f5a142dbb04394ad19ffefd4, '{{ salesChannel.name }}', 'Password reset - {{ salesChannel.name }}', 'Password reset request', '<div style=\"font-family:arial; font-size:12px;\">\n    <p>\n        {{ customer.salutation.translated.letterName }} {{ customer.firstName }} {{ customer.lastName }},<br/>\n        <br/>\n        there has been a request to reset you Password in the Shop {{ salesChannel.translated.name }}\n        Please confirm the link below to specify a new password.<br/>\n        <br/>\n        <a href=\"{{ resetUrl }}\">Reset password</a><br/>\n        <br/>\n        This link is valid for the next 2 hours. After that you have to request a new confirmation link.<br/>\n        If you do not want to reset your password, please ignore this email. No changes will be made.\n    </p>\n</div>\n', '{{ customer.salutation.translated.letterName }} {{customer.firstName}} {{ customer.lastName }},\n\nthere has been a request to reset you Password in the Shop {{ salesChannel.translated.name }}\nPlease confirm the link below to specify a new password.\n\nReset password: {{ resetUrl }}\n\nThis link is valid for the next 2 hours. After that you have to request a new confirmation link.\nIf you do not want to reset your password, please ignore this email. No changes will be made.', NULL, '2023-05-29 13:22:29.819', NULL),
