(0x6886f633f4d24bb5bc2535886cc8a58f, 0x2fbb5fe2e29a4d70aa5854ce7ce3e20b, 'Shopware Administration', 'Password-Wiederherstellung', '', '<div style=\"font-family:arial; font-size:12px;\">\n    <p>\n        Hallo {{ userRecovery.user.firstName }} {{ userRecovery.user.lastName }},<br/>\n        <br/>\n        es wurde eine Anfrage gestellt, um Ihr Passwort zurck zu setzen.\n        Bitte besttigen Sie den unten stehenden Link, um ein neues Passwort zu definieren.<br/>\n        <br/>\n        <a href=\"{{ resetUrl }}\">Passwort zurcksetzen</a><br/>\n        <br/>\n        Dieser Link ist nur fr die nchsten 2 Stunden gltig. Danach muss das Zurcksetzen des Passwortes erneut beantragt werden.\n        Falls Sie Ihr Passwort nicht zurcksetzen mchten, ignorieren Sie diese E-Mail - es wird dann keine nderung vorgenommen.\n    </p>\n</div>', '        Hallo {{ userRecovery.user.firstName }} {{ userRecovery.user.lastName }},\n\n        es wurde eine Anfrage gestellt, um Ihr Passwort zurck zu setzen.\n        Bitte besttigen Sie den unten stehenden Link, um ein neues Passwort zu definieren.\n\n        Passwort zurcksetzen: {{ resetUrl }}\n\n        Dieser Link ist nur fr die nchsten 2 Stunden gltig. Danach muss das Zurcksetzen des Passwortes erneut beantragt werden.\n        Falls Sie Ihr Passwort nicht zurcksetzen mchten, ignorieren Sie diese E-Mail - es wird dann keine nderung vorgenommen.', NULL, '2023-05-29 13:22:34.167', NULL),
(0x6886f633f4d24bb5bc2535886cc8a58f, 0x7f68cf92f5a142dbb04394ad19ffefd4, 'Shopware Administration', 'Password recovery', '', '<div style=\"font-family:arial; font-size:12px;\">\n    <p>\n        Dear {{ userRecovery.user.firstName }} {{ userRecovery.user.lastName }},<br/>\n        <br/>\n        there has been a request to reset your password.\n        Please confirm the link below to specify a new password.<br/>\n        <br/>\n        <a href=\"{{ resetUrl }}\">Reset password</a><br/>\n        <br/>\n        This link is valid for the next 2 hours. After that you have to request a new confirmation link.<br/>\n        If you do not want to reset your password, please ignore this email. No changes will be made.\n    </p>\n</div>', '        Dear {{ userRecovery.user.firstName }} {{ userRecovery.user.lastName }},\n\n        there has been a request to reset your password.\n        Please confirm the link below to specify a new password.\n\n        Reset password: {{ resetUrl }}\n\n        This link is valid for the next 2 hours. After that you have to request a new confirmation link.\n        If you do not want to reset your password, please ignore this email. No changes will be made.', NULL, '2023-05-29 13:22:34.166', NULL),
