(0x99ef0c0ec7e94f919f72c4bb09e03a5f, 0x2fbb5fe2e29a4d70aa5854ce7ce3e20b, '{{ salesChannel.name }}', 'Neues Dokument fr Ihre Bestellung', NULL, '<div style=\"font-family:arial; font-size:12px;\">\n\n    {% if order.orderCustomer.salutation %}{{ order.orderCustomer.salutation.translated.letterName ~ \' \' }}{% endif %}{{ order.orderCustomer.firstName }} {{ order.orderCustomer.lastName }},<br>\n    <br>\n    Im Anhang dieser E-Mail finden Sie die Gutschrift fr Ihre Bestellung mit der Nummer: {{ order.orderNumber }}<br>\n    <br>\n    Sollten Sie Fragen haben, zgern Sie nicht, uns zu kontaktieren.\n    <br>\n</div>\n', '{% if order.orderCustomer.salutation %}{{ order.orderCustomer.salutation.translated.letterName ~ \' \' }}{% endif %}{{ order.orderCustomer.firstName }} {{ order.orderCustomer.lastName }},\n\nIm Anhang dieser E-Mail finden Sie die Gutschrift fr Ihre Bestellung mit der Nummer: {{ order.orderNumber }}\n\nSollten Sie Fragen haben, zgern Sie nicht, uns zu kontaktieren.\n', NULL, '2023-05-29 13:23:46.080', NULL),
