rbessertes Behandeln von Auftrge kleiner oder gleich Null\"], \"2.1.0\": [\"E-Mail-Probleme behoben\"], \"2.1.1\": [\"Runde Betrge\", \"Weiterleiten, wenn der Wagen nicht neu erstellt werden kann\"], \"3.0.0\": [\"Korrigieren Sie die Transaktionsversionierung\", \"Aktualisieren Sie das SDK\"], \"3.1.0\": [\"Untersttzung fr Custom Products Plugin\"], \"4.0.0\": [\"Untersttzung fr Shopware 6.4\"], \"4.0.1\": [\"Feste Steuerberechnung fr kundenspezifische Produkte\"], \"4.0.2\": [\"Der Name der Versand-Einzelposten wurde korrigiert\"], \"4.0.3\": [\"Aktualisieren Sie das SDK\"], \"4.0.4\": [\"Erstattungen von Werbebuchungen\"], \"4.0.5\": [\"Deinstallation Aktion des Plugins behoben\"], \"4.0.6\": [\"Fehler beim ndern des Lieferstatus behoben\"], \"4.0.7\": [\"Behebung des Transaktions-Rollback-Fehlers in nicht untersttzten Sprachen\"], \"4.0.8\": [\"Automatische bermittlung des Checkout-Formulars implementiert, wenn iFrame keine Eingabefelder zurckgibt\"], \"4.0.9\": [\"Erlaube, den Zahlungsstatus als bezahlt ab Status erinnert zu markieren\"], \"1.1.10\": [\"Reagieren Sie nicht mehr mit Serverfehlern, wenn keine Bestellungen gefunden werden\"], \"1.1.11\": [\"Dokumentation hinzufgen\"], \"1.1.12\": [\"Dokumentpfad aktualisieren\"], \"1.1.13\": [\"Fgen Sie den Lieferantenordner in Shopware Store-Versionen ein\"], \"1.1.14\": [\"Fgen Sie dem Cookie-Manager Cookies hinzu\", \"ndern Sie die Gre des Symbols auf 40px * 40px\", \"Korrektur von Werbebuchungsattributen\"], \"1.1.15\": [\"Senden Sie den Vor- und Nachnamen des Kunden aus den Rechnungs- und Versandprofilen\", \"Respektieren Sie die Shop-URL\"], \"1.1.16\": [\"Stellen Sie nur bersetzungen fr verfgbare Sprachen bereit\", \"CustomerCanceledAsyncPaymentException fr stornierte Transaktionen zurckgeben\", \"Aktualisieren Sie das SDK auf 2.1.1\"], \"1.1.17\": [\"Verwenden Sie DAL fr Webhook-Sperren\"], \"1.1.18\": [\"Test gegen Shopware 6.3\", \"Fehler bei ungltiger Speicherplatz-ID behoben\", \"Entfernen Sie die fest 