enische bersetzungen hinzugefgt\", \"Getestet mit SW v6.4.9.0\"], \"4.0.29\": [\"Korrektur zum Ausblenden des Geburtsdatumsfelds, wenn es bereits vorhanden ist\", \"Getestet mit SW v6.4.9.0\"], \"4.0.45\": [\"Fgen Sie zustzliche Informationen der Kreditkarte (Gltigkeitsdatum, Pseudo-Kreditkartennummer und PayID) fr Transaktionen mit dieser Zahlungsmethode hinzu\", \"Getestet mit SW v6.4.17.1\", \"\"], \"4.0.50\": [\"Steuerinformationen wurden von der Versands- zu der Rechnungsstellung verschoben.\", \"Teilweise war die Synchronisierung der Portal Daten zu SW6 unvollstndig.\", \"Lsen eines Fehlers: Der bezahlte Betrag im Portal wurde nicht an SW6 gemeldet.\", \"Lsen eines Fehlers: Nach Wechsel der Zahlungsmethode im Checkout, wurde der Zahlungsstatus auf \\\"bezahlt\\\" gesetzt.\", \"Lsen eines Fehlers: Beim Auflisten der Zahlungsmethoden durch den Kunden im Checkout Prozess.\"], \"4.0.51\": [\"Falsches Linkformat in der Fehlermeldung.\"], \"4.0.52\": [\"Untersttzung von Shopware 6.4.20.1\"], \"4.0.53\": [\"Erstellung einer neuen Spalte in der Transaktionstabelle mit dem Namen erp_merchant_id\"], \"4.0.54\": [\"Untersttzung von Shopware 6.5\", \"Untersttzung des neuesten PHP SDK 3.2.0\"]}', NULL, '2023-07-03 11:39:01.106', '2023-09-10 20:23:20.698'),
