(0x298bc03b95d9454b9de450a3044817bb, 0x7f68cf92f5a142dbb04394ad19ffefd4, 'Wallee Products for Shopware 6', 'Wallee integration for Shopware 6', 'https://www.wallee.com', 'https://app-wallee.com/space/select?target=/support', '{\"1.0.0\": [\"First version of the Wallee integrations for Shopware 6\"], \"1.1.0\": [\"Handle empty/default Settings values\", \"Save refunds to db, and reload order tab on changes\"], \"1.1.1\": [\"Stop default emails being sent\", \"Prettify payment page\"], \"1.1.2\": [\"Prepare internal server side install for showcases and demos\"], \"1.1.3\": [\"Make line item consistency default\", \"Confirm transaction right away\", \"Update settings descriptions\"], \"1.1.4\": [\"Disable changing credentials on the showcases\"], \"1.1.5\": [\"Fix settings bug\"], \"1.1.6\": [\"Disable sales channel selection on showcases\", \"Add product attributes to transaction payload\"], \"1.1.7\": [\"Implement promotions\", \"Code refactoring\"], \"1.1.8\": [\"Remove unhelpful tickets info in release comments\"], \"1.1.9\": [\"Put try catch on webhook install\"], \"1.2.0\": [\"Add payment method availability rule\", \"Hardcoded system languages\"], \"1.3.0\": [\"Update payment method syncing\"], \"1.4.0\": [\"Fix payment method availability rule\", \"Fix email sending\", \"Cancel failed orders\"], \"1.4.1\": [\"Fetch active payment methods only\"], \"1.4.2\": [\"Fix payment method bug on first time install\"], \"1.4.3\": [\"Silence missing order webhook errors\", \"Fix iframe breakout\"], \"2.0.0\": [\"Fix cart recreation on promotions\", \"Remove availability rules\", \"Handle orders less than or equal to zero\"], \"2.1.0\": [\"Fix email issues\"], \"2.1.1\": [\"Round amounts\", \"Redirect if the cart can not be recreated\"], \"3.0.0\": [\"Fix transaction versioning\", \"Update SDK\"], \"3.1.0\": [\"Support for Custom Products plugin\"], \"4.0.0\": [\"Support for Shopware 6.4\"], \"4.0.1\": [\"Fixed tax calculation for custom products\"], \"4.0.2\": [\"Fixed shipping line item name\"], \"4.0.3\": [\"Update SDK\"], \"4.0.4\": [\"Line item based refunds\"], \"4.0.5\": [\"Fixed plugin uninstall action\"], \"4.0.6\": [\"Fix for delivery state change error\"], \"4.0.7\": [\"Fix Transaction Rollback error on unsupported languages\"], \"4.0.8\": [\"Checkout form auto submission implemented when iFrame returns no input fields\"], \"4.0.9\": [\"Allow to mark payment status as paid from status reminded\"], \"1.1.10\": [\"Stop responding with server errors when orders are not found\"], \"1.1.11\": [\"Add documentation\"], \"1.1.12\": [\"Update doc path\"], \"1.1.13\": [\"Include vendor folder in Shopware store releases\"], \"1.1.14\": [\"Add cookies to the cookie manager\", \"Resize icon to 40px * 40px\", \"Fix line item attributes\"], \"1.1.15\": [\"Send customer first name and last name from billing and shipping profiles\", \"Respect Shop URL\"], \"1.1.16\": [\"Only provide translations for available languages\", \"Return CustomerCanceledAsyncPaymentException on cancelled transactions\", \"Update SDK to 2.1.1\"], \"1.1.17\": [\"Use DAL on webhook locks\"], \"1.1.18\": [\"Test against Shopware 6.3\", \"Fix error on invalid space id\", \"Remove hardcoded Shopware API version\"], \"1.1.19\": [\"Allow customers to download order invoices\"], \"1.1.20\": [\"Update webhook URLs on plugin update\", \"Add translations\", \"Fix email bug\"], \"1.1.21\": [\"Remove hardcoded Shopware API version\"], \"1.1.22\": [\"Order invoice download setting\"], \"1.1.23\": [\"Submit payment form when iframe has no fields\"], \"1.1.24\": [\"Fix webhook response\", \"Fix translation\", \"Prepare for Shopware 6.4\"], \"1.1.25\": [\"Fix Email sending\"], \"1.1.26\": [\"Fix locales and translations\"], \"1.1.27\": [\"Retry orders on unavailable payment method\"], \"4.0.10\": [\"Fixed \\\"Allow payment change after checkout\\\" option behavior\"], \"4.0.11\": [\"Reverted auto-submit on empty iframe as it is not working properly at all cases\"], \"4.0.12\": [\"Security fix\"], \"4.0.13\": [\"Loader Chrome IOS fix\"], \"4.0.14\": [\"Support for Shopware 6.4.6\"], \"4.0.15\": [\"Adjust wallee/SW6 documentation - how to do refunds\"], \"4.0.16\": [\"Added settings to control update of webhooks and payment methods\"], \"4.0.17\": [\"Fixed settings to import webhooks and payment methods\"], \"4.0.20\": [\"Fixed company name for shipping address\"], \"4.0.21\": [\"Custom products options displayed as separate line items\"], \"4.0.22\": [\"Added support for French\"], \"4.0.23\": [\"Fixed cart recreate function for custom products\"], \"4.0.24\": [\"Added refunds by amount\"], \"4.0.25\": [\"Fixed transaction invoice instant payment handling.\", \"Tested with v6.4.7.0\"], \"4.0.26\": [\"Added documentation around flow builder\"], \"4.0.28\": [\"Added italian translations\", \"Tested against SW v6.4.9.0\"], \"4.0.29\": [\"Fix to hide birthdate field if it\'s already provided\", \"Tested against SW v6.4.9.0\"], \"4.0.36\": [\"Compatibility SW v6.4.13.0\"], \"4.0.41\": [\"Sends to the payment portal a more specific version of shopware being used.\"], \"4.0.42\": [\"Rollback to remove functionality of sending version to payment portal\"], \"4.0.45\": [\"Add additional information of the Credit Card (Validity Date, Pseudo Credit Card number and PayID) for transaction using this Payment Method\", \"Compatibility SW v6.4.17.1\", \"\"], \"4.0.51\": [\"Wrong link format in error message.\"], \"4.0.52\": [\"Support of Shopware 6.4.20.1\"], \"4.0.53\": [\"Creation of a new column in the transaction table called erp_merchant_id\"], \"4.0.54\": [\"Support of Shopware 6.5\", \"Support of latest PHP SDK 3.2.0\"]}', NULL, '2023-07-03 11:39:01.107', '2023-09-10 20:23:20.699'),
(0x4615d859e3a747419e3363c3ef6528ab, 0x2fbb5fe2e29a4d70aa5854ce7ce3e20b, 'Ein einfaches Produktvergleichs-Plugin fr Shopware 6', 'Kostenloses Open Source Plugin fr Shopware 6. Ermglicht es bis zu 4 Produkte miteinander zu vergleichen. Vergleichsliste auf der Produktvergleichsseite oder auf der Artikelseite.', 'https://github.com/FriendsOfShopware/FroshProductCompare', 'https://github.com/FriendsOfShopware/FroshProductCompare/issues', NULL, NULL, '2023-07-18 21:24:26.029', '2023-09-10 20:23:20.756'),
(0x4615d859e3a747419e3363c3ef6528ab, 0x7f68cf92f5a142dbb04394ad19ffefd4, 'A Simple Product Compare plugin for Shopware 6', 'Free Shopware 6 open source extension which allows to compare up to 4 products with each other. Show compare list in products compare page or in product detail\'s cross-selling.', 'https://github.com/FriendsOfShopware/FroshProductCompare', 'https://github.com/FriendsOfShopware/FroshProductCompare/issues', '{\"1.0.2\": [\"Shopware 6.3 compatibility\"], \"1.0.3\": [\"Fix Cross Selling is not working after installing the plugin.\"], \"1.0.4\": [\"Use `HttpClient` instead of `StoreApiClient`.\"], \"1.0.5\": [\"Small fix on handle click events.\", \"[Issue-9](https://github.com/FriendsOfShopware/FroshProductCompare/issues/9) Add Plugin config `showIconOnly` that only show AddToCompare button with only icon (without Text).\"], \"1.0.6\": [\"[Issue-11] (https://github.com/FriendsOfShopware/FroshProductCompare/issues/11) Fix import scss syntax.\", \"Small refactor on plugin\'s base.html.twig\"], \"1.1.0\": [\"Shopware 6.4 compatibility\", \"[Issue-14] (https://github.com/FriendsOfShopware/FroshProductCompare/issues/14) Fixes cross-sellings compare does not work with product variants\", \"Show variant\'s property option value in compare list\", \"[Issue-15] (https://github.com/FriendsOfShopware/FroshProductCompare/issues/15) Added a new plugin\'s config to toggle between show all/selected properties\", \"Fix minor issues\"], \"1.2.0\": [\"[Issue-20] (https://github.com/FriendsOfShopware/FroshProductCompare/issues/20) Fixes cross-sellings compare does not work with product variants\", \"[Issue-19] (https://github.com/FriendsOfShopware/FroshProductCompare/issues/19) Added a new plugin\'s config to hide attributes (description/price/rating/manufacturer or the whole section)\"], \"1.2.1\": [\"Use plugin name as namespace for own templates: there are errors thrown on 6.4.5.0 for not findable template\", \"Never show rating if review is disabled in shop\", \"Collect all possible propertyGroups of each product for comparison: we are having some different properties. The customer should always see all properties related to compared products\"], \"1.2.2\": [\"Leerzeichen zwischen Tags hinzufgen\"], \"2.0.0\": [\"[Issue-43] (https://github.com/FriendsOfShopware/FroshProductCompare/issues/43) Shopware 6.5 compatibility\", \"[Issue-33] (https://github.com/FriendsOfShopware/FroshProductCompare/issues/33) Add a new toggle in the Comparison page to show only properties have differences between products\", \"[Issue-41] (https://github.com/FriendsOfShopware/FroshProductCompare/issues/41) Support for custom fields (except type json, media, entity), the product\'s custom fields will be shown in the comparison table if they\'re pre-configured in Plugin\'s configuration\", \"Fix various UI bugs and compatible with 6.5 styles: adjust classes name, blocks, styling\", \"Nicer print output - Remove redundant lines, spaces, and cookie bar on printing\", \"Overview and Specification sections are now collapsible\"], \"1.0.0 - first release\": [\"Add `Add to Compare` button in Product Card and Product detail.\", \"Add `Float button` on bottom left of the page with `added products counter`.\", \"Add `Products added to compare list offcanvas` when click `Float button`.\", \"Add `Compare page` to display Compare products table. Up to 4 products can be added into the list.\", \"Add `Print` button in Compare page to print the compare table.\", \"Add `Clear all` button to clear all products in the list.\", \"Add `Comparable switch` in `Administration > Product Detail > Cross-selling tab` that allow to display cross-selling products as a compare table.\"], \"1.0.1 - release on shopware store as frosh\'s plugin\": [\"Remove some redundant LoC.\", \"Add robot noindex meta on Compare page\", \"Update the plugin\'s name and add some store\'s requirements.\"]}', NULL, '2023-07-18 21:24:26.029', '2023-09-10 20:23:20.757'),
(0xaea3204f8b3245f99be75c056ab7072b, 0x2fbb5fe2e29a4d70aa5854ce7ce3e20b, 'Shopware Store', 'Entdecken und kaufen Sie Erweiterungen ganz einfach, direkt in Ihrem eigenen Shopware-Shop. Erhalten Sie Zugang zu vielen Erweiterungen, die Sie in Ihren Shop integrieren knnen.', 'https://www.shopware.com/en/', 'https://www.shopware.com/en/', '{\"1.0.0\": [\"Erster Release im Store\"], \"1.1.0\": [\"Es wurde ein falsches Verhalten gefixt, wenn der Benutzer keine Bezahlmethode hinterlegt hat\", \"Es wird nun eine Warnung angezeigt, falls der Benutzer keine Bezahlmethode hinterlegt hat\"], \"1.2.0\": [\"Wenn die Installation einer Erweiterung fehlgeschlagen ist, wird auf der Detailseite der Erweiterung ein Fehlermodal angezeigt\", \"Es wird nun auch eine Checkbox fr die AVV angezeigt, wenn keine Berechtigungen bentigt werden\", \"Es wurde ein Fehler in der RouteMiddleware behoben. Dieser fhrte dazu, dass manche Plugins keine Routen mehr erweitern konnten\"], \"1.3.0\": [\"Fehler in Route behoben, der die Kompatibilitt bricht\", \"Der Suchbegriff bleibt erhalten whrend man durch den Extension Store navigiert\", \"Fehler bei der Anzeige der Detailseite von Enterprise Erweiterungen behoben\"], \"1.4.0\": [\"Korrigiert die Nachkommastellen in der Preisdarstellung im Erweiterungskaufmodal\", \"Verbessert und refaktoriert die Preisdarstellung auf der Kaufen-Detailseite und dem Kaufen-Modal\", \"Platzhalter zur Suchleiste hinzugefgt und den `initialSearchType` umbenannt\", \"Verbessert Fehlermeldungen\", \"Fehler behoben, der beim Wechseln der Tabs die Seite nicht zurcksetzte\", \"Verbessert Darstellung im Kaufen-Modal, wenn Probemonat bereits genutzt wurde\", \"Verbessert Fehlerbehandlung im Bestellprozess im Kaufen-Modal\"], \"1.4.1\": [\"Fehler behoben, der beim Wechseln der Variante das Kaufen-Modal im Ladezustand lsst\"], \"1.5.0\": [\"Fehler behoben, der den Kaufprozess im Fehlerfall nicht unterbrochen hat\", \"Verbessert den Aufruf der Methode `getCart` in der Komponente `sw-extension-buy-modal`, um sicherzustellen, dass keine zweite Anfrage unntig gesendet wird\", \"Erhht die Version des `@shopware-ag/jest-preset-sw6-admin` Package\", \"Filter fr die Kategorien besitzt nun mehr Ebenen, fr mehr Filteroptionen\"], \"1.6.0\": [\"Ladeanimation im Listing optimiert\"], \"2.0.0\": [\"Kompatibilitt mit Shopware 6.5 sichergestellt\"]}', NULL, '2023-05-29 13:32:37.999', '2023-09-10 20:23:20.796'),
(0xaea3204f8b3245f99be75c056ab7072b, 0x7f68cf92f5a142dbb04394ad19ffefd4, 'Shopware Store', 'Explore and buy extensions easily, right from within your own Shopware shop. Get access to loads of helpful Extensions and modern Themes that can be integrated into your shop.', 'https://www.shopware.com/en/', 'https://www.shopware.com/en/', '{\"1.0.0\": [\"First release in Store\"], \"1.1.0\": [\"Fixed a wrong behavior when user has no payment method\", \"A warning is now displayed if the user has not configured a payment method\"], \"1.2.0\": [\"If the installation of an extension failed, an error modal is displayed on the extension detail page\", \"A checkbox for the AVV is now also displayed if no permissions are required\", \"Fixed a bug in the RouteMiddleware. This caused that some plugins could no longer extend routes\"], \"1.3.0\": [\"Fix annotation in route that breaks compatibility\", \"Keep search term when navigation through the extension store\", \"Fix detail page of Enterprise extensions\"], \"1.4.0\": [\"Fix price precision display in extension buy modal\", \"Improved and refactored price display on buy detail page and in buy modal\", \"Added a placeholder to the search bar and renamed the `initialSearchType`\", \"Improved error messages\", \"Fixed a bug that didn\'t reset the page when switching between tabs\", \"Improved display in buy modal, if trial month has been already used\", \"Improved error handling in the order process in the buy modal\"], \"1.4.1\": [\"Fixed bug that kept the buy modal in loading state after changing the variant\"], \"1.5.0\": [\"Fixed bug that didn\'t interrupt the buying process in case of an error\", \"Changed calling of the `getCart` method in the component `sw-extension-buy-modal` to ensure that no second request is sent unnecessarily.\", \"Increases the version of the `@shopware-ag/jest-preset-sw6-admin` package\", \"Filter for the categories now has more levels, for more filter options\"], \"1.6.0\": [\"Improved loading animation in listing\"], \"2.0.0\": [\"Compatibility with Shopware 6.5\"]}', NULL, '2023-05-29 13:32:37.999', '2023-09-10 20:23:20.796'),
