port for Shopware 6.4\"], \"4.0.1\": [\"Fixed tax calculation for custom products\"], \"4.0.2\": [\"Fixed shipping line item name\"], \"4.0.3\": [\"Update SDK\"], \"4.0.4\": [\"Line item based refunds\"], \"4.0.5\": [\"Fixed plugin uninstall action\"], \"4.0.6\": [\"Fix for delivery state change error\"], \"4.0.7\": [\"Fix Transaction Rollback error on unsupported languages\"], \"4.0.8\": [\"Checkout form auto submission implemented when iFrame returns no input fields\"], \"4.0.9\": [\"Allow to mark payment status as paid from status reminded\"], \"1.1.10\": [\"Stop responding with server errors when orders are not found\"], \"1.1.11\": [\"Add documentation\"], \"1.1.12\": [\"Update doc path\"], \"1.1.13\": [\"Include vendor folder in Shopware store releases\"], \"1.1.14\": [\"Add cookies to the cookie manager\", \"Resize icon to 40px * 40px\", \"Fix line item attributes\"], \"1.1.15\": [\"Send customer first name and last name from billing and shipping profiles\", \"Respect Shop URL\"], \"1.1.16\": [\"Only provide translations for available languages\", \"Return CustomerCanceledAsyncPaymentException on cancelled transactions\", \"Update SDK to 2.1.1\"], \"1.1.17\": [\"Use DAL on webhook locks\"], \"1.1.18\": [\"Test against Shopware 6.3\", \"Fix error on invalid space id\", \"Remove hardcoded Shopware API version\"], \"1.1.19\": [\"Allow customers to download order invoices\"], \"1.1.20\": [\"Update webhook URLs on plugin update\", \"Add translations\", \"Fix email bug\"], \"1.1.21\": [\"Remove hardcoded Shopware API version\"], \"1.1.22\": [\"Order invoice download setting\"], \"1.1.23\": [\"Submit payment form when iframe has no fields\"], \"1.1.24\": [\"Fix webhook response\", \"Fix translation\", \"Prepare for Shopware 6.4\"], \"1.1.25\": [\"Fix Email sending\"], \"1.1.26\": [\"Fix locales and translations\"], \"1.1.27\": [\"Retry orders on unavailable payment method\"], \"4.0.10\": [\"Fixed \\\"Allow payment change after checkout\\\" option behavior\"], \"4.0.